package cn.xgame.config.o;import java.util.Map;import x.javaplus.string.StringUtil;public class Qasd {	public final int ID;	public final byte bagtype;	public final int usegrid;	public final byte usetype;	public final byte outtype;	public final byte defcolor;	public final int buygold;	public final int sellgold;	public final int diamond;	public final byte level;	public final byte maxlevel;	public final byte cansm;	public final long manymax;	public final byte useminlv;	public final String[] conditions;	public final String[] releaseEnd;	public final int reply;	public final byte usemaxcount;	public final int attribute;

	public Qasd( Map<String, String> data ){		ID = Integer.parseInt( StringUtil.convertNumberString( data.get("ID") ) );		bagtype = Byte.parseByte( StringUtil.convertNumberString( data.get("bagtype") ) );		usegrid = Integer.parseInt( StringUtil.convertNumberString( data.get("usegrid") ) );		usetype = Byte.parseByte( StringUtil.convertNumberString( data.get("usetype") ) );		outtype = Byte.parseByte( StringUtil.convertNumberString( data.get("outtype") ) );		defcolor = Byte.parseByte( StringUtil.convertNumberString( data.get("defcolor") ) );		buygold = Integer.parseInt( StringUtil.convertNumberString( data.get("buygold") ) );		sellgold = Integer.parseInt( StringUtil.convertNumberString( data.get("sellgold") ) );		diamond = Integer.parseInt( StringUtil.convertNumberString( data.get("diamond") ) );		level = Byte.parseByte( StringUtil.convertNumberString( data.get("level") ) );		maxlevel = Byte.parseByte( StringUtil.convertNumberString( data.get("maxlevel") ) );		cansm = Byte.parseByte( StringUtil.convertNumberString( data.get("cansm") ) );		manymax = Long.parseLong( StringUtil.convertNumberString( data.get("manymax") ) );		useminlv = Byte.parseByte( StringUtil.convertNumberString( data.get("useminlv") ) );		conditions = data.get("conditions").split(";");		releaseEnd = data.get("releaseEnd").split(";");		reply = Integer.parseInt( StringUtil.convertNumberString( data.get("reply") ) );		usemaxcount = Byte.parseByte( StringUtil.convertNumberString( data.get("usemaxcount") ) );		attribute = Integer.parseInt( StringUtil.convertNumberString( data.get("attribute") ) );

	}}